    setInput1("");
    setInput2("");
  };

  return (
    <div>
      <div className="input-table-container">
        <h1 className="my-header">University ROI Calculator</h1>
        <h2 className="my-subheader">Find and Compare the value in your Education</h2>
        <SearchItems input1={input1} setInput1={setInput1} input2={input2} setInput2={setInput2} handleSubmit={handleSubmit} />
        <table>
          {/* table code */}
        </table>
      </div>
      {/* text container code */}
    </div>
  );
}

export default InputTable;
